  [],\n\t\"revision_timestamp\": \"2015-09-27T02:19:05.597859\",\n\t\"name\": \"auroral-electrojet-index-designed-to-provide-a-global-measure-l-minute-intervals-of-auroral-zon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Auroral Electrojet index (AE) is designed
  to provide a global quantitative measure of auroral zone magnetic activity produced
  by enhanced ionospheric currents flowing below and within the auroral oval. Ideally,
  it is the total range of deviation at an instant of time from quiet day values of
  the horizontal magnetic field (H) around the auroral oval. These indices are computed
  from a network of geomagnetic observations, some recording digitally and othersn
  \                   as analog, which encircle the northern auroral zone. The AE
  computation uses horizontal magnetic field measured at 1-minute intervals. AE plus
  the supplemental indices AL, AU, and AO are contained in this data file. For earlier
  years, the AE indices were derived at 2.5 minutes. Also, hourly mean indices are
  calculated.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
